  <script type="text/babel">
    // Creating the main App component
    const App = () => {
      const [data, setData] = React.useState([]);
      const [loading, setLoading] = React.useState(true);
      const [userInput, setUserInput] = React.useState({ glucose: '', bmi: '', age: '' });
      const [riskResult, setRiskResult] = React.useState(null);

      // Processing and cleaning the dataset
      const processAndCleanData = (rawData) => {
        return rawData
          .filter(row => row.Glucose && row.BMI && row.Age && row.Outcome) // Discard invalid rows
          .map(row => ({
            ...row,
            Glucose: Number(row.Glucose) || 0,
            BMI: Number(row.BMI) || 0,
            Age: Number(row.Age) || 0,
            Outcome: Number(row.Outcome) || 0,
          }))
          .filter(row => row.Glucose > 0 && row.BMI > 0 && row.Age > 0); // Remove invalid values
      };

      // Loading the CSV data
      React.useEffect(() => {
        const csv = loadFileData("Healthcare-Diabetes.csv");
        Papa.parse(csv, {
          header: true,
          skipEmptyLines: true,
          transformHeader: header => header.trim().replace(/^"|"$/g, ''),
          transform: value => value.trim().replace(/^"|"$/g, ''),
          complete: (results) => {
            const cleanedData = processAndCleanData(results.data);
            setData(cleanedData);
            setLoading(false);
          },
          error: (err) => {
            console.error(err);
            setLoading(false);
          }
        });
      }, []);

      // Calculating statistics for risk assessment
      const diabeticData = data.filter(row => row.Outcome === 1);
      const nonDiabeticData = data.filter(row => row.Outcome === 0);
      const meanGlucoseDiabetic = diabeticData.length ? diabeticData.reduce((sum, row) => sum + row.Glucose, 0) / diabeticData.length : 0;
      const meanBMIDiabetic = diabeticData.length ? diabeticData.reduce((sum, row) => sum + row.BMI, 0) / diabeticData.length : 0;

      // Handling user input changes
      const handleInputChange = (e) => {
        const { name, value } = e.target;
        setUserInput(prev => ({ ...prev, [name]: value }));
      };

      // Assessing diabetes risk based on user input
      const assessRisk = (e) => {
        e.preventDefault();
        const glucose = Number(userInput.glucose);
        const bmi = Number(userInput.bmi);
        const age = Number(userInput.age);

        if (isNaN(glucose) || isNaN(bmi) || isNaN(age) || glucose <= 0 || bmi <= 0 || age <= 0) {
          setRiskResult('Please enter valid numbers for all fields.');
          return;
        }

        const glucoseThreshold = meanGlucoseDiabetic * 0.9; // 90% of mean diabetic glucose
        const bmiThreshold = meanBMIDiabetic * 0.9; // 90% of mean diabetic BMI
        const ageThreshold = 40; // Arbitrary age threshold based on dataset trends

        const riskFactors = [
          glucose > glucoseThreshold,
          bmi > bmiThreshold,
          age > ageThreshold
        ].filter(Boolean).length;

        let riskMessage;
        if (riskFactors >= 2) {
          riskMessage = 'High risk of diabetes. Consult a healthcare professional.';
        } else if (riskFactors === 1) {
          riskMessage = 'Moderate risk of diabetes. Monitor your health.';
        } else {
          riskMessage = 'Low risk of diabetes. Maintain a healthy lifestyle.';
        }

        setRiskResult(`Risk Assessment: ${riskMessage}`);
      };

      // Creating age bins for bar chart
      const ageBins = [
        { range: '20-30', diabetic: 0, nonDiabetic: 0 },
        { range: '30-40', diabetic: 0, nonDiabetic: 0 },
        { range: '40-50', diabetic: 0, nonDiabetic: 0 },
        { range: '50+', diabetic: 0, nonDiabetic: 0 }
      ];

      data.forEach(row => {
        if (row.Age >= 20 && row.Age < 30) {
          row.Outcome === 1 ? ageBins[0].diabetic++ : ageBins[0].nonDiabetic++;
        } else if (row.Age >= 30 && row.Age < 40) {
          row.Outcome === 1 ? ageBins[1].diabetic++ : ageBins[1].nonDiabetic++;
        } else if (row.Age >= 40 && row.Age < 50) {
          row.Outcome === 1 ? ageBins[2].diabetic++ : ageBins[2].nonDiabetic++;
        } else if (row.Age >= 50) {
          row.Outcome === 1 ? ageBins[3].diabetic++ : ageBins[3].nonDiabetic++;
        }
      });

      // Rendering loading state
      if (loading) {
        return (
          <div className="flex justify-center items-center h-screen">
            <p className="text-xl text-gray-700">Loading data...</p>
          </div>
        );
      }

      // Rendering the main content
      return (
        <div className="container mx-auto p-4">
          {/* Creating the summary section */}
          <h1 className="text-3xl font-bold mb-4 text-center text-blue-700">Diabetes Risk Analysis</h1>
          <p className="text-lg mb-6 text-gray-700">
            This application analyzes a diabetes dataset to identify patterns and assess risk. The dataset includes metrics like Glucose, BMI, and Age, which are key indicators of diabetes. Below, you'll find visualizations of the data and a tool to estimate your diabetes risk based on your inputs.
          </p>
          <p className="text-lg mb-6 text-gray-700 font-semibold">
            Interesting Fact: Patients with glucose levels above 180 mg/dL are significantly more likely to be diagnosed with diabetes, with some outliers showing levels as high as 199 mg/dL.
          </p>

          {/* Creating the Glucose distribution histogram */}
          <div className="mb-8">
            <h2 className="text-2xl font-semibold mb-2 text-gray-800">Glucose Level Distribution</h2>
            <Recharts.ResponsiveContainer width="100%" height={400}>
              <Recharts.Histogram
                data={data}
                margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
              >
                <Recharts.XAxis dataKey="Glucose" label={{ value: 'Glucose (mg/dL)', position: 'insideBottom', offset: -10, fontSize: 12 }} />
                <Recharts.YAxis label={{ value: 'Count', angle: -90, position: 'insideLeft', fontSize: 12 }} />
                <Recharts.Legend />
                <Recharts.Histogram
                  dataKey="Glucose"
                  name="Diabetic"
                  type="monotone"
                  fill="#ff7300"
                  stackId="1"
                  filter={data.filter(d => d.Outcome === 1)}
                />
                <Recharts.Histogram
                  dataKey="Glucose"
                  name="Non-Diabetic"
                  type="monotone"
                  fill="#387908"
                  stackId="1"
                  filter={data.filter(d => d.Outcome === 0)}
                />
                <Recharts.Tooltip />
              </Recharts.Histogram>
            </Recharts.ResponsiveContainer>
          </div>

          {/* Creating the Glucose vs. BMI scatter plot */}
          <div className="mb-8">
            <h2 className="text-2xl font-semibold mb-2 text-gray-800">Glucose vs. BMI</h2>
            <Recharts.ResponsiveContainer width="100%" height={400}>
              <Recharts.ScatterChart margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
                <Recharts.CartesianGrid strokeDasharray="3 3" />
                <Recharts.XAxis dataKey="Glucose" name="Glucose" unit=" mg/dL" label={{ value: 'Glucose (mg/dL)', position: 'insideBottom', offset: -10, fontSize: 12 }} />
                <Recharts.YAxis dataKey="BMI" name="BMI" unit=" kg/m" label={{ value: 'BMI (kg/m)', angle: -90, position: 'insideLeft', fontSize: 12 }} />
                <Recharts.Tooltip cursor={{ strokeDasharray: '3 3' }} />
                <Recharts.Legend />
                <Recharts.Scatter name="Diabetic" data={diabeticData} fill="#ff7300" />
                <Recharts.Scatter name="Non-Diabetic" data={nonDiabeticData} fill="#387908" />
              </Recharts.ScatterChart>
            </Recharts.ResponsiveContainer>
          </div>

          {/* Creating the age group bar chart */}
          <div className="mb-8">
            <h2 className="text-2xl font-semibold mb-2 text-gray-800">Diabetes Prevalence by Age Group</h2>
            <Recharts.ResponsiveContainer width="100%" height={400}>
              <Recharts.BarChart data={ageBins} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
                <Recharts.CartesianGrid strokeDasharray="3 3" />
                <Recharts.XAxis dataKey="range" label={{ value: 'Age Group', position: 'insideBottom', offset: -10, fontSize: 12 }} />
                <Recharts.YAxis label={{ value: 'Count', angle: -90, position: 'insideLeft', fontSize: 12 }} />
                <Recharts.Tooltip />
                <Recharts.Legend />
                <Recharts.Bar dataKey="diabetic" name="Diabetic" fill="#ff7300" stackId="a" />
                <Recharts.Bar dataKey="nonDiabetic" name="Non-Diabetic" fill="#387908" stackId="a" />
              </Recharts.BarChart>
            </Recharts.ResponsiveContainer>
          </div>

          {/* Creating the user input form for risk assessment */}
          <div className="mb-8">
            <h2 className="text-2xl font-semibold mb-2 text-gray-800">Check Your Diabetes Risk</h2>
            <div className="bg-white p-6 rounded-lg shadow-md">
              <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
                <div>
                  <label className="block text-gray-700">Glucose (mg/dL)</label>
                  <input
                    type="number"
                    name="glucose"
                    value={userInput.glucose}
                    onChange={handleInputChange}
                    className="w-full p-2 border rounded"
                    placeholder="Enter glucose level"
                  />
                </div>
                <div>
                  <label className="block text-gray-700">BMI (kg/m)</label>
                  <input
                    type="number"
                    name="bmi"
                    value={userInput.bmi}
                    onChange={handleInputChange}
                    className="w-full p-2 border rounded"
                    placeholder="Enter BMI"
                  />
                </div>
                <div>
                  <label className="block text-gray-700">Age</label>
                  <input
                    type="number"
                    name="age"
                    value={userInput.age}
                    onChange={handleInputChange}
                    className="w-full p-2 border rounded"
                    placeholder="Enter age"
                  />
                </div>
              </div>
              <button
                onClick={assessRisk}
                className="mt-4 bg-blue-500 text-white p-2 rounded hover:bg-blue-600"
              >
                Assess Risk
              </button>
              {riskResult && (
                <p className="mt-4 text-lg text-gray-700">{riskResult}</p>
              )}
            </div>
          </div>

          {/* Creating the conclusion section */}
          <div>
            <h2 className="text-2xl font-semibold mb-2 text-gray-800">Conclusion</h2>
            <p className="text-lg text-gray-700">
              The dataset reveals strong correlations between high glucose levels, elevated BMI, and increased age with diabetes risk. The visualizations highlight that diabetic patients often have glucose levels above {Math.round(meanGlucoseDiabetic)} mg/dL and BMIs above {Math.round(meanBMIDiabetic)} kg/m. Use the form above to assess your risk and consult a healthcare professional for accurate diagnosis and advice.
            </p>
          </div>
        </div>
      );
    };

    // Rendering the App component
    const root = ReactDOM.createRoot(document.getElementById('root'));
    root.render(<App />);
  </script>
</body>
</html>
